          "Type": "House",
          "Price":16000,
          },
          {
            "Id": 6,
            "Name" : "Biara House VI",
            "Type": "House",
            "Price":17000,
            },
            {
              "Id": 7,
              "Name" : "Biara House VII",
              "Type": "House",
              "Price":18000,
              },
              {
                "Id": 8,
                "Name" : "Biara House VIII",
                "Type": "House",
                "Price":19000,
                },
  ]
}
<div class="row gy-5 col-6"> 
  <div *ngFor="let Item of Properties" class="col-sm-4 p-3">
